import React from "react";
import styled from "styled-components";

const ContainerFooter = styled.footer`
  ul {
    display: table;
    margin: 0 auto;
  }
`;

const ContainerNav = styled.nav`
  padding: 15px 0;

  ul {
    display: table;
    margin: 0 auto;
  }

  li {
    float: left;
    list-style-type: none;
    padding: 0 30px 0 0;
  }
`;

const ListLink = styled.ul`
  display: table;
  margin: 0 auto;
`;

const ItemLink = styled.li`
  float: left;
  padding: 0 30px 0 0;
  list-style-type: none;

  a {
    margin-left: 5px;
    color: black;
    text-decoration: none;
  }
`;

const Footer = () => {
  return (
    <>
    <ContainerFooter>
      <ContainerNav>
        <ListLink>
          <></>
        </ListLink>
      </ContainerNav>
    </ContainerFooter>
      <footer>
        <nav class="footer">
          <ul>
            <li>
              <a href="about.html">About</a>
            </li>
            <li>
              <a
                rel="”noopener”"
                target="_blank"
                href="https://linkedin.com/in/maria-eduarda-lipinski/"
              >
                LinkedIn
              </a>
            </li>
            <li>
              <a
                rel="”noopener”"
                target="_blank"
                href="https://www.instagram.com/dudalipinski/"
              >
                Instagram
              </a>
            </li>
          </ul>
        </nav>
      </footer>
    </>
  );
};

export default Footer;
